import axios from "axios";

export const ReviewAPI = async (setReviewData, restaurantID, setPageNum) => {
  const url = `http://3.35.140.28:9000/shop/${restaurantID}/review?pageIndex=1&pageSize=10`;

  try {
    const data = await axios({
      method: "get",
      url: url,
    });
    setReviewData(data.data.result);
  } catch (err) {
    alert(err);
  }
};

export default ReviewAPI;
